When we perform: let mut hi = a.mul_add(b, c1); What occurs behind the scenes is: Computation of a * b with infinite precision, which will have an exponent of at most 51 * 2 = 102. Addition of c1 = (0, 103, 0x0000000000000) to a * b, which forces the result to have an exponent of 103, and preserving bits 52-103 in the the 52-bit mantissa. During the addition step, the result is rounded up if the 52nd bit is 1, and not rounded if it is 0. Let's visualise this with example values a = 1596695558896492 and b = 1049164860932151. The binary representation of the full (non-floating-point) product of a * b + c1 is: ╭╴ 104th bit
10010101001001001101... 10110 101111110101001101101...10100 ╰─ The higher 52 bits ────╯ ╰─ The lower 51 bits ────╯ ╰─ The rounding bit Compare the above with the binary representation of the mantissa of the floating-point value hi = a.mul_add(b, c1): 01000110011000111101110101100010110110...11 │╰─ e=103──╯╰── mantissa (rounded up) ────╯ ╰╴ Sign (positive) 52 ╯ Observe that the mantissa of hi is greater by 1 (...10 vs ...11). This is because the CPU rounds this floating point value up as the 51st bit is 1. Next, to understand how we get the lower 52 bits, let us expand the computation of sub and lo: let sub = c2 - hi;
let mut lo = a.mul_add(b, sub); sub is negative, and contains the high bits. Adding sub to a * b zeros out the high bits, forces the exponent to 52, and leaves us with the lower 52 bits. (a * b) + sub =
(a * b) + (c2 ) - hi =
(a * b) + (2^103 + 3 * 2^51) - hi │ │ ╰─ Subtracts the high bits and 2^103 from c2 │ ╰─ Sets the exponent of the result to 52, and sets bit 52 to 1 ╰─ Computes a * b with full precision (102 bits) Observe that c2 (which is 2^103 + 3 * 2^51) forces the result to have an exponent of 52. This is because the binary representation of c2 as a floating-point is: 0100011001100000000000...00011 ╰─e=103───╯╰─ 52 bits ────╯ No matter what value hi has, since the bits for 252 and 253 are set, the result will be at least 252, which forces the mantissa to retain the lower 51 bits. Finally, we subtract 1 from hi if the 51st (leftmost) bit of lo is 1, and apply a bitmask to lo to ensure that we only have the lower 51 bits.

