First, let us define some constants: c1 is a f64 with the value 2103. In our format, it is: (0, 103, 0x0000000000000). In hexadecimal, it is 0x4660000000000000. c2 is a f64 with the value 2103+3∗251. In our format, it is: (0, 103, 0x0000000000003). In hexadecimal, it is 0x4660000000000003. Next, compute the floating points hi, sub, and lo: let mut hi = a.mul_add(b, c1);
let sub = c2 - hi;
let mut lo = a.mul_add(b, sub); Next, we subtract c1.to_bits() from hi.to_bits(), effectively applying a bitmask. This approach allows multiple product terms to be summed, followed by a single subtraction, rather than applying a bitmask each time a product is computed (EZW18 p131). let mut hi = hi.to_bits() - c1.to_bits(); Finally, we perform a conditional subtraction on the high bits, mask the low bits, and return the results. let lo = lo.to_bits() & mask;
// If the lower word is negative, subtract 1 from the higher word
if lo & 0x4000000000000u64 > 0 { hi -= 1;
} return (hi, lo); Also note that this subtraction may be omitted if the multiprecision arithmetic algorithm you use performs carry propagation.
